import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Layout from "./components/Layout";
import GlobalStyles from "./styles/GlobalStyles";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path="/">
            <>
              <Layout />
              <GlobalStyles />
            </>
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;

